script: |
  super -f tsv -I q530.sql | sort > q530.out

vector: true

inputs:
  - name: q530.sql
    data: |
      SELECT DISTINCT + ( + tab0.col2 ) * 92 + tab0.col2 * - tab0.col2 - ( 93 + - col0 ) * 0 / col2 AS col1 FROM tab0;
  - name: tab0

outputs:
  - name: q530.out
    data: |
      1947
      820
      91
